import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Carousel from 'react-bootstrap/Carousel';
import { Link } from "react-router-dom";


export default function Home() {
  return (
    <div>
      {/* <br/>
      <h1 style={{textAlign:'center', fontWeight:'bold'}}>RESILIENCE VISITATION</h1>
      <br/> */}
      <Carousel>
        <Carousel.Item interval={4000}>
          <img
            className="d-block w-100"
            src="pic/01.jpg"
            alt="Image One"
          />

          <Carousel.Caption>
            <h1>Resilience Visitation
</h1>
            {/* <p>Sample Text for Image One</p> */} 
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item interval={4000}>
          <img
            className="d-block w-100"
src="pic/02.jpg"
            alt="Image Two"
          />
          <Carousel.Caption>
            {/* <h3>Label for second slide</h3>
            <p>Sample Text for Image Two</p> */}
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item interval={4000}>
          <img
            className="d-block w-100"
src="pic/03.jpg"
            alt="Image Three"
          />
          <Carousel.Caption>
            {/* <h3>Label for second slide</h3>
            <p>Sample Text for Image Two</p> */}
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>


      <div>
    {/* <ul>RESILIENCE VISITATION</ul> */}

  <br/>
  <ul>
    <p>
     <h5>Let’s face it. Parenting can be hard. There’s a reason people say “it takes a village.” Resilience Visitation is seeking a professional in social services ready to come alongside parents navigating the child welfare system. We support parents in 1.) recognizing and meeting their children’s needs, 2.) having regular opportunities to connect with their children in foster care and 3.) developing the discipline and skill they need to address the concern(s) that led to their children’s removal.</h5>     </p>
     <p>
   <h5> Resilience Visitation is an innovative new provider of family visitation in Bozeman, Livingston, and the surrounding area. We are led by our shared commitment to fostering resilience, offering dignity, and practicing transparency. We work closely with Child and Family Services, foster parents, and other service providers to bring separated families opportunities to nurture relationships in the most natural setting possible and to support parents as they work toward their treatment plan goals.
   </h5> </p>
  </ul>
  </div>
  <br></br>
  <br></br>


  <div className="card-group">
  <div className="card">
  <Link to="/map"> 
    <img className="card-img-top" src="pic/04.jpg" alt="Card image cap"/> </Link> 
    <div className="card-body">
      <h5 className="card-title">About</h5>
      <p className="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
      {/* <p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p> */}
    </div>
  </div>

  <div className="card">
    <Link to="/profile"> 
    <img className="card-img-top" src="pic/06.jpg" alt="Card image cap"/> </Link>
    <div className="card-body"> 
      <h5 className="card-title">Models</h5>
      <p className="card-text">This card has supporting text below as a natural lead-in to additional content.</p>
      {/* <p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p> */}
    </div>
  </div>

  <div className="card">
    <Link to="/login">
    <img className="card-img-top" src="pic/05.jpg" alt="Card image cap"/> </Link>
    <div className="card-body">
      <h5 className="card-title">Apply Now To Join The Team</h5>
      <Link to="/login" />
      <p className="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This card has even longer content than the first to show that equal height action.</p>
      {/* <p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p> */}

    </div>
  </div>
</div>


<br></br>
  <br></br>
  <br></br>
  <br></br>
  <br></br>
  <br></br>
  <br></br>
  <br></br>
  <br></br>

    </div>



  );
}







